import styled from "styled-components";
import background from "./assets/images/toelf-ielts3.jpg"

export const Wrapper = styled.div`
    width:100vw;
    height:100vh;
    background-size:25%;
    margin: 0;
    `

export const EmailStyle = styled.div`
    width: 100%;
    height: 90%;
    display: flex;
    align-items: center;
    justify-content: center;
    font-size:small;
    margin: 0;
    `
